function webApplications(){document.getElementById("appDropdown").classList.toggle("show")}function responsiveBanner(){document.getElementById("bannerDropdown").classList.toggle("show")}function responsiveEmail(){document.getElementById("emailDropdown").classList.toggle("show")}function videoLink(){document.getElementById("videoDropdown").classList.toggle("show")}function artLink(){document.getElementById("artDropdown").classList.toggle("show")}window.onclick=function(a){if(!a.target.matches(".dropbtn")){var b,c=document.getElementsByClassName("dropdown-content");for(b=0;b<c.length;b++){var d=c[b];d.classList.contains("show")&&d.classList.remove("show")}}};